import React, { Component } from "react";
import { Breadcrumb, Icon, Row, Col, Layout, Card, Carousel, Input } from "antd";
// import "../../static/css/style.scss";
class Login extends Component {
  render() {
    return (
      <Layout>
        <Row>
          <Col span={14} md={14} xs={24}>
            Login Page
          </Col>
          <Col span={10} md={10} xs={24}>
            <Layout className="card">
              <p className="login-title">
                <h2>Welcome to Pathstage</h2>
              </p>
              <Row>
                <Col span={1} md={1} xs={1}>
                  <Icon type="mail" />
                </Col>
                <Col span={23} md={23} xs={23}>
                  <Input placeholder="Email" className="email" />
                </Col>
              </Row>
              <Row>
                <Col span={1} md={1} xs={1}>
                  <Icon type="password" />
                </Col>
                <Col span={23} md={23} xs={23}>
                  <Input className="email" placeholder="input password" />
                </Col>
              </Row>
            </Layout>
          </Col>
        </Row>
      </Layout>
    );
  }
}

export default Login;
